import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';

function AdminDashboard() {
    const [enquiries, setEnquiries] = useState([]);
    const [blocks, setBlocks] = useState([]);
    const [grease, setGrease] = useState([]);
    const [bearing, setBearing] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [contactRes, blockRes, greaseRes, bearingRes] = await Promise.all([
                    fetch('http://localhost:5000/api/contact'),
                    fetch('http://localhost:5000/api/blocks'),
                    fetch('http://localhost:5000/api/grease'),
                    fetch('http://localhost:5000/api/bearing')
                ]);

                const contactData = await contactRes.json();
                const blockData = await blockRes.json();
                const greaseData = await greaseRes.json();
                const bearingData = await bearingRes.json();

                if (contactRes.ok) setEnquiries(contactData);
                if (blockRes.ok) setBlocks(blockData);
                if (greaseRes.ok) setGrease(greaseData);
                if (bearingRes.ok) setBearing(bearingData);

                setLoading(false);
            } catch (err) {
                setError('Failed to fetch data');
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    const handleLogout = () => {
        localStorage.clear();
        sessionStorage.clear();
        navigate('/');
    };

    return (
        <div className="admin-container">
            <div className="dashboard-header">
                <h2>Customer Enquiries</h2>
                <button className="logout-button" onClick={handleLogout}>Logout</button>
            </div>

            {loading && <p>Loading data...</p>}
            {error && <p style={{ color: 'red' }}>{error}</p>}

            {/* Enquiries */}
            <ul className="enquiry-list">
                {enquiries.map((enquiry, index) => (
                    <li key={index} className="enquiry-card">
                        <p><strong>Name:</strong> {enquiry.name}</p>
                        <p><strong>Email:</strong> {enquiry.email}</p>
                        <p><strong>Message:</strong> {enquiry.message}</p>
                    </li>
                ))}
            </ul>

            {/* Products Section */}
            <h2>Manage Products</h2>

            <h3>Block Products</h3>
            <ul className="product-list">
                {blocks.map((item, index) => (
                    <li key={index} className="product-card">
                        <p><strong>Name:</strong> {item.name}</p>
                        <p><strong>Price:</strong> ₹{item.price}</p>
                        <p><strong>Stock:</strong> {item.stock}</p>
                    </li>
                ))}
            </ul>

            <h3>Grease Products</h3>
            <ul className="product-list">
                {grease.map((item, index) => (
                    <li key={index} className="product-card">
                        <p><strong>Name:</strong> {item.name}</p>
                        <p><strong>Category:</strong> {item.category}</p>
                        <p><strong>Price:</strong> ₹{item.price}</p>
                        <p><strong>Stock:</strong> {item.stock}</p>
                        <p><strong>Offer:</strong> {item.offer ? 'Yes' : 'No'}</p>
                        <img src={item.image} alt={item.name} width="100" />
                    </li>
                ))}
            </ul>

            <h3>Bearing Products</h3>
            <ul className="product-list">
                {bearing.map((item, index) => (
                    <li key={index} className="product-card">
                        <p><strong>Name:</strong> {item.name}</p>
                        <p><strong>Price:</strong> ₹{item.price}</p>
                        <p><strong>Stock:</strong> {item.stock}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default AdminDashboard;
